import React, { useState } from "react";
import { useEffect } from "react";
import "./Register.css";

const Register = () => {
  const [formChange, setFormChange] = useState({
    tempname: "",
    tempemail: "",
    tempnumber: "",
    tempfile: null,
  });

  const fname = formChange.tempname;
  const femail = formChange.tempemail;
  const fnumber = formChange.tempnumber;
  const ffile = formChange.tempfile;

  const [finalChange, setFinalChange] = useState({
    name: "",
    email: "",
    number: "",
    file: null,
  });

  const change = (event) => {
    event.preventDefault();
    const val = event.target.value;
    const nam = event.target.name;
    const fileName = event.target.files[0];

    if (nam == "Name") {
      setFormChange({
        ...formChange,
        tempname: val,
      });
    }

    if (nam == "email") {
      setFormChange({
        ...formChange,
        tempemail: val,
      });
    }

    if (nam == "number") {
      setFormChange({
        ...formChange,
        tempnumber: val,
      });
    }

    if (nam == "photo") {
      setFormChange({
        ...formChange,
        tempfile: fileName,
      });
    }
  };

  const formSubmit = (event) => {
    event.preventDefault();

    setFinalChange({
      name: fname,
      email: femail,
      number: fnumber,
      file: ffile,
    });

    // fetch(
    //   "https://faceapiv-service.ubsbto1gdi65m.us-west-2.cs.amazonlightsail.com/register",
